'mail/chrome/messenger/messengercompose/composeMsgs.properties:12589' => 'ලිපිය යැවීමේදී දෝෂයක් ඇතිවිය: SMTP සේවාදායකය %S නොදනී. සේවාදායක වින්‍යාස කිරීමේ වැරැක්දක් විය හැකිය. කරුණාකර SMTP සේවාදායකයේ සැකසුම් නිවැරදි බව සහතික කර නැවත උත්සාහ කරන්න.',
