'mail/chrome/messenger/messengercompose/composeMsgs.properties:12584' => 'ලිපිය යැවීමේදී දෝෂයක් ඇතිවිය: %S සඳහා රහස්පදය ලබාගත නොහැකිය. ලිපිය යැව්වේ නැත.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12587' => 'ඔබ යැවීමට උත්සාහ කරන ලිපියේ විශාලත්වය සේවාදායකයේ පොදු විශාලත්ව සීමාව (%d bytes) ඉක්මවයි. ලිපිය යැව්වේ නැත; ලිපියේ විශාලත්වය අඩුකර නැවත උත්සාහ කරන්න.',
