'mail/chrome/messenger/messengercompose/composeMsgs.properties:12592' => 'SMTP සේවාදායකය %S ට වූ සමිබන්ධය කිළය ඉක්මවීම වීම නිසා ලිපිය යැවීමට නොහැකි විය. නැවත උත්සාහ කරන්න, හෝ ඔබගේ ජාල පරිපාලක හමුවන්න.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12593' => 'SMTP සේවාදායකය %S සඳහා වූ නොදන්නා දෝෂයක් නිසා ලිපිය යැවීමට නොහැකි විය. කරුණාකර SMTP සේවාදායකයේ සැකසුම් නිවැරදි බව සහතික කර නැවත උත්සාහ කරන්න, හෝ ඔබගේ ජාල පරිපාලක හමුවන්න.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12590' => 'SMTP සේවාදායකය %S ට සමිබන්ධ විය නොහැකි නිසා ලිපිය යැවීමට නොහැකි විය. සේවාදායකය නොමැති වීම හෝ SMTP සබඳතා ප්‍රතික්ෂේප කරනවා විය හැකිය. කරුණාකර SMTP සේවාදායකයේ සැකසුම් නිවැරදි බව සහතික කර නැවත උත්සාහ කරන්න, හෝ ඔබගේ සේවාදාහකයේ පරිපාලක හමුවන්න.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12591' => 'SMTP සේවාදායකය %S ට වූ සමිබන්ධය අතරමැදදී අහිමි වීම නිසා ලිපිය යැවීමට නොහැකි විය. නැවත උත්සාහ කරන්න, හෝ ඔබගේ ජාල පරිපාලක හමුවන්න.',
'mail/chrome/messenger/messengercompose/composeMsgs.properties:12596' => 'SMTP සේවාදායකය %S සාමාන්‍ය පාඨ රහස්පද සඳහා ඉඩ නොදේ. &#39;ගිණුම් සැකසුම් | සේවාදායක සැකසුම්&#39; හි  &#39;සත්‍යාපන ක්‍රමය (Authentication method)&#39; ලෙස  &#39;ගුප්තකේතනය කළ රහස්පද (Encrypted password)&#39; සකසා උත්සාහ කරන්න&#39;.',
'mail/chrome/messenger/addressbook/abMainWindow.dtd:newContactButton.tooltip' => 'ලිපින පොතට නව සබඳතාවක් එක් කිරීමට',
